import{_ as r,c as a,a as t,o as h}from"./app.109432a7.js";const c=JSON.parse('{"title":"2022\uB144 \uD68C\uACE0","description":"","frontmatter":{"title":"2022\uB144 \uD68C\uACE0","createBy":"2023-01-08T00:00:00.000Z"},"headers":[{"level":2,"title":"","slug":"_2022\uB144-\uD68C\uACE0\uB85D"},{"level":2,"title":"(1) \uAE30\uB2A5\uB300\uD68C","slug":"_1-\uAE30\uB2A5\uB300\uD68C"},{"level":2,"title":"(2) \uD68C\uC0AC \uC774\uC9C1 \uBC0F \uCDE8\uC5C5","slug":"_2-\uD68C\uC0AC-\uC774\uC9C1-\uBC0F-\uCDE8\uC5C5"},{"level":2,"title":"(3) \uC5EC\uD589","slug":"_3-\uC5EC\uD589"},{"level":2,"title":"(4) \uACE0\uB4F1\uD559\uAD50 \uC878\uC5C5","slug":"_4-\uACE0\uB4F1\uD559\uAD50-\uC878\uC5C5"}],"relativePath":"sdhs/2212/2022\uB144\uD68C\uACE0.md"}'),i={name:"sdhs/2212/2022\uB144\uD68C\uACE0.md"};function l(d,e,s,n,b,p){return h(),a("div",null,e[0]||(e[0]=[t('<h2 id="_2022\uB144-\uD68C\uACE0\uB85D" tabindex="-1"><h2 style="font-size:30px;">2022\uB144 \uD68C\uACE0\uB85D</h2> <a class="header-anchor" href="#_2022\uB144-\uD68C\uACE0\uB85D" aria-hidden="true">#</a></h2><p>\uC62C\uD574\uB294 \uB0B4\uAC00 \uACE0\uB4F1\uD559\uC0DD\uC73C\uB85C \uC788\uB294 \uB9C8\uC9C0\uB9C9 \uD55C\uD574\uC600\uB2E4. 2\uB144\uC804 \uACE0\uB4F1\uD559\uC0DD\uC774 \uB418\uC5C8\uC744\uB54C\uB294 \uC878\uC5C5\uD560\uB0A0\uC774 \uC774\uB807\uAC8C \uBE68\uB9AC \uC62C\uC904\uC740 \uBAB0\uB790\uB294\uB370 \uC815\uB9D0 3\uB144\uC774\uB780 \uC2DC\uAC04\uC774 \uBE60\uB974\uAC8C \uC9C0\uB098\uAC04\uAC83 \uAC19\uB2E4. <br><br> 2022\uB144\uB3C4\uB294 \uC9C0\uAE08\uAE4C\uC9C0 \uC0B4\uC558\uB358 19\uB144\uB3D9\uC548 \uC81C\uC77C \uD798\uB4E4\uC5C8\uB358 1\uB144\uC774\uC5C8\uC73C\uBA70 \uAC00\uC7A5 \uBCF4\uB78C\uCC3C\uB358 \uD55C\uD574\uC600\uB358\uAC83 \uAC19\uB2E4. \uB300\uD68C, \uBA74\uC811, \uCDE8\uC5C5, \uC9C1\uC7A5\uC0DD\uD65C\uAE4C\uC9C0 \uD559\uC0DD\uC5D0\uC11C \uC131\uC778\uC73C\uB85C \uB118\uC5B4\uAC00\uB294 \uC2DC\uAE30\uB77C\uC11C \uADF8\uB7F0\uC9C0 \uCD08\uB4F1\uD559\uAD50\uC5D0\uC11C \uC911\uD559\uAD50, \uC911\uD559\uAD50\uC5D0\uC11C \uACE0\uB4F1\uD559\uAD50\uB85C \uC9C4\uD559\uD588\uB358 \uB290\uB08C\uACFC\uB294 \uD655\uC5F0\uD788 \uBB34\uC5B8\uAC00\uAC00 \uB2E4\uB978 \uB290\uB08C\uC774\uB2E4. \uBAA8\uB4E0\uC77C\uC5D0 \uCC45\uC784\uC774\uB780\uAC8C \uC0DD\uAE30\uACE0 \uB0B4 \uB9D0\uACFC \uD589\uB3D9 \uD558\uB098\uD558\uB098\uB97C \uC870\uC2EC\uD574\uC57C \uB41C\uB2E4\uB294\uAC8C \uB108\uBB34 \uC5B4\uB824\uC6B4\uAC83 \uAC19\uB2E4. \uC55E\uC73C\uB85C \uC77C\uC744\uD560\uC218 \uC788\uB294 \uB098\uC774\uAE4C\uC9C0 \uACC4\uC18D \uC77C\uC744 \uD558\uBA74\uC11C \uC0B4\uC544\uC57C\uD558\uB294\uB370 \uC774\uB807\uAC8C \uC0DD\uAC01\uD558\uBA74 \uACE0\uB4F1\uD559\uAD50 \uC878\uC5C5\uD6C4 \uBC14\uB85C \uCDE8\uC5C5\uD55C\uAC8C \uC798\uBABB\uD55C\uAC74\uAC00 \uC2F6\uAE30\uB3C4 \uD55C\uB2E4. <br><br> \uADF8\uB798\uB3C4 \uADF8\uB9CC\uD07C\uC758 \uBA54\uB9AC\uD2B8\uAC00 \uC788\uAE30 \uB54C\uBB38\uC5D0 \uC120\uD0DD\uD55C \uAE38\uC774\uB2C8 \uD798\uB4E4\uC5B4\uB3C4 \uCC38\uACE0 \uBE68\uB9AC \uC801\uC751 \uD558\uB294\uC218 \uBC16\uC5D0... <br><br> \uBB50 \uC544\uBB34\uD2BC \uD68C\uACE0\uB85D \uC2DC\uC791 ~</p><h2 id="_1-\uAE30\uB2A5\uB300\uD68C" tabindex="-1">(1) \uAE30\uB2A5\uB300\uD68C <a class="header-anchor" href="#_1-\uAE30\uB2A5\uB300\uD68C" aria-hidden="true">#</a></h2><hr><p>2022\uB144\uB3C4 \uAC00\uC7A5 \uC758\uBBF8\uC788\uACE0 \uC778\uC0C1\uAE4A\uC5C8\uB358 \uC77C\uC744 \uB9D0\uD574\uBCF4\uC790\uBA74 \uB2F9\uC5F0\uD788 \uAE30\uB2A5\uB300\uD68C\uC5D0 \uCD9C\uC804\uD55C \uAC83\uC774\uB2E4. <br><br> \uBE44\uB85D \uB2E4\uB978 \uCC38\uAC00\uC790\uB4E4\uD55C\uD14C\uB294 \uC544\uB2D0\uC9C0 \uBAA8\uB974\uACA0\uC9C0\uB9CC \uB098\uD55C\uD14C\uB294 \uC9C0\uAE08\uAE4C\uC9C0 \uC0B4\uBA74\uC11C \uAC00\uC7A5 \uC5F4\uC2EC\uD788 \uD588\uB358\uAC8C \uBC14\uB85C \uAE30\uB2A5\uB300\uD68C \uC900\uBE44\uC600\uB358\uAC83 \uAC19\uB2E4. 1\uD559\uB144 \uB9D0\uBD80\uD130 \uACC4\uC18D \uAE30\uB2A5\uBC18\uC5D0 \uB0A8\uC544\uC11C 9\uC2DC\uAE4C\uC9C0 \uACF5\uBD80\uD588\uACE0 \uBC29\uD559\uBC18\uB0A9\uC5D0 \uB300\uD68C \uC900\uBE44\uAE30\uAC04\uC5D0\uB294 \uC8FC\uB9D0\uAE4C\uC9C0 \uB098\uC640\uC11C \uC900\uBE44\uD588\uAE30 \uB54C\uBB38\uC5D0 \uC815\uB9D0 \uB9D8 \uB193\uACE0 \uC274\uC218 \uC788\uB294\uB0A0\uC774 \uAC70\uC758 \uC5C6\uC5C8\uB2E4(\uADF8\uB098\uB9C8 \uC2DC\uD5D8\uAE30\uAC04\uC774 \uAC00\uC7A5 \uC9D1\uC5D0 \uC77C\uCC0D \uB4E4\uC5B4\uAC04 \uB0A0\uB4E4\uC774\uB2E4). <br><br> 2\uD559\uB144\uB54C\uB3C4 \uC9C0\uBC29\uB300\uD68C\uC5D0 \uCD9C\uC804\uD558\uAE30 \uD588\uC9C0\uB9CC \uAE30\uB2A5\uBC18\uC5D0 \uB4E4\uC5B4\uC628\uC9C0\uB3C4 \uBCC4\uB85C \uC548\uB42C\uC5C8\uACE0 \uC2E4\uB825\uB3C4 \uB9CE\uC774 \uBAA8\uC790\uB77C\uC11C \uC804\uAD6D\uB300\uD68C\uB294 \uAFC8\uB3C4 \uBABB\uAFE8\uC73C\uB2C8... <br><br> \uACE02\uB54C \uBABB\uB098\uAC14\uB358\uAC8C \uD55C\uC774 \uB418\uC11C 3\uD559\uB144\uB54C \uB9CE\uC774 \uC900\uBE44\uD574\uC11C \uB098\uAC04\uAC83 \uAC19\uB2E4.</p><h2 id="_2-\uD68C\uC0AC-\uC774\uC9C1-\uBC0F-\uCDE8\uC5C5" tabindex="-1">(2) \uD68C\uC0AC \uC774\uC9C1 \uBC0F \uCDE8\uC5C5 <a class="header-anchor" href="#_2-\uD68C\uC0AC-\uC774\uC9C1-\uBC0F-\uCDE8\uC5C5" aria-hidden="true">#</a></h2><hr><p>\uC62C\uD574 \uB2E4\uB978\uD68C\uC0AC\uB85C \uC774\uC9C1\uC744 \uD588\uB2E4. <br><br> 2\uD559\uB144\uB54C 1\uB2EC \uB2E4\uB154\uB358 \uD68C\uC0AC\uB791 \uC880 \uC77C\uC774\uC788\uC5B4\uC11C \uC0C8\uB85C \uBA74\uC811\uC744 \uBCF4\uACE0 \uB2E4\uB978\uD68C\uC0AC\uB85C \uC774\uC9C1\uC744 \uD588\uC5C8\uB2E4. \uD558\uC9C0\uB9CC 1\uD559\uAE30\uB54C 1\uB2EC\uAC04 \uC2E4\uC2B5\uC744 \uB098\uAC14\uC5C8\uB294\uB370 \uADF8\uB54C \uD68C\uC0AC\uC5D0\uC11C \uAC70\uC758 \uBC30\uC6B4\uAC83\uB3C4 \uC5C6\uACE0 \uD68C\uC0AC \uB300\uD45C\uD55C\uD14C \uAC11\uC9C8\uB3C4 \uB2F9\uD574\uC11C \uB610 \uB2E4\uB978\uD68C\uC0AC\uB85C \uC774\uC9C1\uD588\uB2E4. <br><br> \uC774\uC9C1\uD55C \uD68C\uC0AC\uC5D0\uC11C\uB294 \uCC98\uC74C\uAC00\uC11C \uADF8\uB7F0\uC9C0 \uD68C\uC0AC\uC0DD\uD65C\uC5D0 \uC801\uC751\uC744 \uBABB\uD574\uC11C \uAC70\uC758 \uD3D0\uAE09\uC774\uC5C8\uB294\uB370 \uC774\uC81C\uB294 \uC5B4\uB290\uC815\uB3C4 \uC801\uC751\uC744 \uD574\uC11C \uCD08\uCC3D\uAE30\uBCF4\uB2E4\uB294 \uC798 \uB2E4\uB2C8\uACE0 \uC788\uB2E4.</p><h2 id="_3-\uC5EC\uD589" tabindex="-1">(3) \uC5EC\uD589 <a class="header-anchor" href="#_3-\uC5EC\uD589" aria-hidden="true">#</a></h2><hr><p>\uC774\uBC88\uB144\uB3C4 11\uC6D4\uB2EC\uC5D0 \uB09C\uC0DD \uCC98\uC74C \uC77C\uBCF8 \uC624\uC0AC\uCE74\uB85C \uC5EC\uD589\uC744 \uAC14\uB2E4. \uBE44\uB85D \uC790\uC720\uC5EC\uD589\uC740 \uC544\uB2C8\uACE0 \uAC00\uC774\uB4DC\uB97C \uB530\uB77C \uB2E4\uB2C8\uB294 \uC5EC\uD589\uC774\uC5C8\uC9C0\uB9CC 4\uBC15 5\uC77C\uB3D9\uC548 \uB2E4\uB978\uB098\uB77C \uC74C\uC2DD\uB3C4 \uBA39\uACE0 \uAD00\uAD11\uC9C0\uB3C4 \uB3CC\uC544\uB2E4\uB2C8\uBA74\uC11C \uC7AC\uBC0C\uAC8C \uB180\uB2E4\uAC00 \uC654\uB2E4. <br><br> \uCCAB\uB0A0\uC5D0\uB294 \uC880 \uBD88\uC548\uD588\uB294\uB370 \uD55C\uAD6D\uC73C\uB85C \uB3CC\uC544\uAC00\uB294 \uB9C8\uC9C0\uB9C9\uB0A0\uC5D0\uB294 \uB9CE\uC774 \uC544\uC26C\uC5C8\uB2E4. \uC774\uBC88\uB144\uB3C4\uC5D0\uB294 \uB3C8\uC744 \uC880 \uBAA8\uC544\uC11C \uB0B4\uB3C8\uC73C\uB85C \uBD80\uBAA8\uB2D8\uACFC \uAC19\uC774 \uD574\uC678\uC5EC\uD589\uC5D0 \uAC00\uACE0 \uC2F6\uB2E4.</p><h2 id="_4-\uACE0\uB4F1\uD559\uAD50-\uC878\uC5C5" tabindex="-1">(4) \uACE0\uB4F1\uD559\uAD50 \uC878\uC5C5 <a class="header-anchor" href="#_4-\uACE0\uB4F1\uD559\uAD50-\uC878\uC5C5" aria-hidden="true">#</a></h2><hr><p>\uC774\uC81C \uACE0\uB4F1\uD559\uAD50 \uC878\uC5C5\uB3C4 \uBCC4\uB85C \uC548\uB0A8\uC558\uB2E4. <br><br> \uACE0\uB4F1\uD559\uAD50 \uB4E4\uC5B4\uC624\uC790\uB9C8\uC790 \uCF54\uB85C\uB098 \uD130\uC9C0\uACE0 \uD559\uAD50 \uD589\uC0AC\uB098 \uC678\uBD80\uD65C\uB3D9\uB3C4 \uB2E4 \uCF54\uB85C\uB098 \uB54C\uBB38\uC5D0 \uBB3C\uAC74\uB108\uAC14\uACE0 \uACE03\uB54C \uACA8\uC6B0 \uC0DD\uAE34 \uAD6D\uB0B4 \uC218\uD559\uC5EC\uD589\uB3C4 \uB300\uD68C \uC77C\uC815\uC774\uB791 \uACB9\uCCD0\uC11C \uBABB\uAC14\uB294\uB370 \uACE0\uB4F1\uD559\uAD50 \uCE5C\uAD6C\uB4E4\uACFC\uC758 \uCD94\uC5B5\uC774 \uC5C6\uB2E4\uB294\uAC8C \uB108\uBB34 \uC544\uC27D\uB2E4. \uCF54\uB85C\uB098\uB9CC \uC544\uB2C8\uC5C8\uC5B4\uB3C4 \uC880\uB354 \uCD94\uC5B5\uC774 \uB9CE\uC740 \uD559\uAD50 \uC0DD\uD65C\uC774 \uB42C\uC744\uAC83 \uAC19\uB2E4. <br><br> \uCD94\uC5B5\uC774 \uC5C6\uC5B4\uC11C \uADF8\uB7F0\uC9C0 \uB2E4 \uC5F0\uB77D\uD558\uBA74\uC11C \uAC00\uB054 \uC800\uB141\uB3C4 \uAC19\uC774 \uBA39\uC5B4\uC11C \uADF8\uB7F0\uC9C0 \uB531\uD788 \uCE5C\uAD6C\uB4E4\uACFC \uD5E4\uC5B4\uC838\uC11C \uC2AC\uD508 \uB290\uB08C\uC740 \uC5C6\uACE0 \uD68C\uC0AC\uC5D0\uC11C \uB178\uC608\uCC98\uB7FC \uC77C\uD560\uAC83 \uAC19\uC544\uC11C \uBD88\uD589\uD558\uB2E4\uB294 \uC0DD\uAC01\uC774 \uC880\uB354 \uB9CE\uC774 \uB4E0\uB2E4.</p><br><br><br><br><br><br><br><h1 style="font-size:37px;margin:7px 0px 12px;">Keep</h1><h4 id="\uC798\uD558\uACE0-\uC788\uB294-\uC810-\uACC4\uC18D-\uD588\uC73C\uBA74-\uC88B\uACA0\uB2E4-\uC2F6\uC740-\uC810" tabindex="-1">\uC798\uD558\uACE0 \uC788\uB294 \uC810. \uACC4\uC18D \uD588\uC73C\uBA74 \uC88B\uACA0\uB2E4 \uC2F6\uC740 \uC810. <a class="header-anchor" href="#\uC798\uD558\uACE0-\uC788\uB294-\uC810-\uACC4\uC18D-\uD588\uC73C\uBA74-\uC88B\uACA0\uB2E4-\uC2F6\uC740-\uC810" aria-hidden="true">#</a></h4><hr><ul><li><p style="font-size:17px;font-weight:bold;">\uC774\uBC88\uB144\uB3C4\uC5D0 \uC5F4\uC2EC\uD788 \uB300\uD68C\uC900\uBE44\uB97C \uD55C\uAC83\uCC98\uB7FC \uD68C\uC0AC\uC0DD\uD65C\uB3C4 \uD2B8\uB7EC\uBE14\uC5C6\uC774 \uC5F4\uC2EC\uD788 \uD558\uBA74 \uC88B\uC744\uAC83 \uAC19\uB2E4.</p></li></ul><br><br><br><h1 style="font-size:37px;margin:7px 0px 12px;">Problem</h1><h4 id="\uBB54\uAC00-\uBB38\uC81C\uAC00-\uC788\uB2E4-\uC2F6\uC740-\uC810-\uBCC0\uD654\uAC00-\uD544\uC694\uD55C-\uC810" tabindex="-1">\uBB54\uAC00 \uBB38\uC81C\uAC00 \uC788\uB2E4 \uC2F6\uC740 \uC810. \uBCC0\uD654\uAC00 \uD544\uC694\uD55C \uC810. <a class="header-anchor" href="#\uBB54\uAC00-\uBB38\uC81C\uAC00-\uC788\uB2E4-\uC2F6\uC740-\uC810-\uBCC0\uD654\uAC00-\uD544\uC694\uD55C-\uC810" aria-hidden="true">#</a></h4><hr><ul><li><p style="font-size:17px;font-weight:bold;">\uC6D0\uB798 \uC880 \uC0B4\uC774 \uCA84\uC788\uB294 \uBAB8\uC774\uC9C0\uB9CC \uACC4\uC18D\uBA39\uACE0 \uCEF4\uD4E8\uD130 \uC55E\uC5D0\uC11C \uCF54\uB529\uD558\uB2E4\uBCF4\uB2C8 \uBAB8\uC774 \uC810\uC810 \uAC00\uB85C\uB85C \uCEE4\uC9C4\uB2E4. 2023\uB144\uC5D0\uB294 \uC6B4\uB3D9\uC744 \uC5F4\uC2EC\uD788 \uD574\uC11C \uC0B4\uC744 \uBE7C\uACE0 \uC2F6\uB2E4.</p></li></ul><br><br><br><h1 style="font-size:37px;margin:7px 0px 12px;">Try</h1><h4 id="\uC798\uD558\uACE0-\uC788\uB294-\uAC83\uC744-\uB354-\uC798\uD558\uAE30-\uC704\uD574\uC11C-\uBB38\uC81C\uAC00-\uC788\uB294-\uC810\uC744-\uD574\uACB0\uD558\uAE30-\uC704\uD574\uC11C-\uC6B0\uB9AC\uAC00-\uC2DC\uB3C4\uD574-\uBCFC-\uAC83\uB4E4" tabindex="-1">\uC798\uD558\uACE0 \uC788\uB294 \uAC83\uC744 \uB354 \uC798\uD558\uAE30 \uC704\uD574\uC11C, \uBB38\uC81C\uAC00 \uC788\uB294 \uC810\uC744 \uD574\uACB0\uD558\uAE30 \uC704\uD574\uC11C \uC6B0\uB9AC\uAC00 \uC2DC\uB3C4\uD574 \uBCFC \uAC83\uB4E4 <a class="header-anchor" href="#\uC798\uD558\uACE0-\uC788\uB294-\uAC83\uC744-\uB354-\uC798\uD558\uAE30-\uC704\uD574\uC11C-\uBB38\uC81C\uAC00-\uC788\uB294-\uC810\uC744-\uD574\uACB0\uD558\uAE30-\uC704\uD574\uC11C-\uC6B0\uB9AC\uAC00-\uC2DC\uB3C4\uD574-\uBCFC-\uAC83\uB4E4" aria-hidden="true">#</a></h4><hr><ul><li><p style="font-size:17px;font-weight:bold;">\uC810\uC810 \uC2DC\uAC04\uC774 \uC9C0\uB0A0\uC218\uB85D \uB098\uD0DC\uD574\uC9C0\uACE0 \uCD08\uC2EC\uC744 \uC783\uC5B4\uAC00\uB294\uAC83 \uAC19\uB2E4. \uCD08\uC2EC\uC744 \uC783\uC9C0 \uB9D0\uACE0 \uAFB8\uC900\uD788 \uACF5\uBD80\uD558\uB294 \uC2B5\uAD00\uC744 \uB4E4\uC774\uB3C4\uB85D \uB178\uB825\uD558\uC790.</p></li></ul><br>',40)]))}var _=r(i,[["render",l]]);export{c as __pageData,_ as default};
